import React, { Fragment } from 'react'
import { Row, Col } from 'react-materialize'


class SnippetView extends React.Component {

  render() {
    return (

      <Row>
        <Col s={6} offset={'s3'}>
          <div style={divStyle}>
            hello
          </div>
        </Col>
      </Row>

    )
  }
}

export default SnippetView;


const divStyle = {
  margin: '40px',
  background: 'black',
  border: '5px solid pink',
  color: 'white',
}
